import QRCode from 'qrcode'
  export default {
      name:"qrCode",
      data(){
          return {
          }
      },
    methods: {
      useqrcode(){
        var canvas = document.getElementById('canvas')
        QRCode.toCanvas(canvas, process.env.VUE_APP_QR_CODE+this.code, function (error) {
          if (error) console.error(error)
          // console.log('QRCode success!');
        })
      }
    },
    props:['code'],
    mounted(){
        this.useqrcode();
    }
  }
